import React from 'react';
import '../App';
import {Link} from 'react-router-dom';

export const Navbar =() =>{
    return ( 
        <div className='nav-bar'>
            <ul className='nav-list'>
              <Link to ="/mental-health">  <li>Mental Health</li></Link>
            <Link  to ="/pro-dev" > <li>Professional Development</li></Link>
            <Link to ="/finances" >  <li>Finances</li></Link>
            <Link to="/nutrition" > <li>Nutrition</li></Link>
            <Link to ="/hobbies" >  <li>Hobbies</li></Link>
            <Link to ="/future-athletes" > <li>Future Athletes</li></Link>

            </ul>

        </div>
    )

}
export default Navbar;
